import React from "react";
import { BsArrowRightShort } from "react-icons/bs";

const Table = (prop) => {
  return (
    <>
      <div className="c_table">
        <table className="table table-hover text-center table-bordered ">
          <thead className="fs-5">
            <tr>
              <th scope="col">#</th>
              <th scope="col">Name</th>
              <th scope="col">Role</th>
              <th scope="col">Action</th>
            </tr>
          </thead>
          <tbody>
            {console.log(prop.content)}
            {prop.content.map((value, key) => {
              return (
                <>
                  <tr>
                    <th scope="row">{value.id}</th>
                    <td className="fs-5 text-uppercase">{value.name}</td>
                    <td className="text-uppercase"> {value.role}</td>
                    <td>
                      <BsArrowRightShort className="fs-3 enter" />
                    </td>
                  </tr>
                </>
              );
            })}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default Table;
